import { StyleSheet } from "react-native"

export const stylesTheme = StyleSheet.create({

  dark: {
    theme: {
      mainView: {
        flex: 1,
        backgroundColor: 'black'
      },
      text: {
        color: 'white'
      },
    },
    buttonColor: 'gray',
  },
  light: {
    theme: {
      mainView: {
        flex: 1,
        backgroundColor: 'white'
      }
    },
    textView: {
      text: {
        color: 'black'
      }
    },
    buttonColor: 'black',
  }
})
